import React from 'react';
import {data} from './data.js';
import List from './List.js'

function App() {
return (
  <main>
    <section className='container'>
      <h3>0 birthdays today</h3>
      <List data={data}/>
      <button>Clear All</button>
    </section>
  </main>
)
}

export default App;
